import React from 'react';
import problems_list from "./problems"

class problem_page extends React.Component{
    constructor({match, location}) {
        super();
        this.id = match.params.problem_id;
    }
    render() {


        return (
            <div>
                <h1>Я {problems_list[this.id]} задача</h1>
            </div>
        )
    }
}

export default problem_page;
